	bool SolidBlock::placeSolid(BlockEventArgs &args, int base_id)
	{
		const BlockState* currentBlock = BlockState::globalPalette[args.currentBlockId];
		if (currentBlock->replaceable())
		{
			args.world->setBlock(args.x, args.y, args.z, base_id);
			return true;
		}
		return false;
	}

	bool SnowyBlock::placeSnowy(BlockEventArgs &args, int base_id)
	{
		if (args.currentBlock->replaceable())
		{
			args.world->setBlock(args.x, args.y, args.z, base_id + 1 /*+1 = snowy: false*/);
			return true;
		}
		return false;
	}

	bool Herb::placeHerb(BlockEventArgs &args, int base_id)
	{
		if (args.currentBlock->replaceable() && args.currentBlockId != base_id)
		{
			args.world->setBlock(args.x, args.y, args.z, base_id);
			return true;
		}
		return false;
	}
	bool Herb::updateRoot(World* wld, int x, int y, int z) const
	{
		if (--y < 0 || wld->getBlock(x, y, z) == Air::getId())
		{
			wld->setBlock(x, ++y, z, Air::getId());
			return true;
		}
		return false;
	}

	bool Liquid::placeLiquid(BlockEventArgs &args, int base_id)
	{
		if (args.currentBlock->isLiquid())
		{
			const LevelProperty* level = args.currentBlock->level();
			int id = level->set((level->get() + 1) % 16);
			args.world->setBlock(args.x, args.y, args.z, id);
			return true;
		}
		if (args.currentBlock->replaceable())
		{
			args.world->setBlock(args.x, args.y, args.z, base_id);
			return true;
		}
		return false;
	}

	bool Log::placeLog(BlockEventArgs &args, int base_id)
	{
		if (args.currentBlock->replaceable())
		{
			AxisOrientation axis = Y;
			switch (args.face)
			{
			case BlockFace::north:
			case BlockFace::south:
				axis = AxisOrientation::Z;
				break;
			case BlockFace::west:
			case BlockFace::east:
				axis = AxisOrientation::X;
			}
			args.world->setBlock(args.x, args.y, args.z, base_id + axis);
			return true;
		}
		return false;
	}
