	bool Bed::updateBed(World* wld, int x, int y, int z, int expectId) const
	{
		int ix = x,
			iy = y,
			iz = z;
		if (PartProperty::value == head)
		{
			//check foot part
			switch ((Facing2D)FacingProperty::value)
			{
			case Facing2D::north:
				z++;
				break;
			case Facing2D::south:
				z--;
				break;
			case Facing2D::east:
				x--;
				break;
			case Facing2D::west:
				x++;
			}
			if (wld->getBlock(x, y, z) == expectId)
				return false;
			wld->setBlock(ix, iy, iz, Air::getId());
			return true;
		}
		else //foot
		{
			//check head part
			switch ((Facing2D)FacingProperty::value)
			{
			case Facing2D::north:
				z--;
				break;
			case Facing2D::south:
				z++;
				break;
			case Facing2D::east:
				x++;
				break;
			case Facing2D::west:
				x--;
			}
			if (wld->getBlock(x, y, z) == expectId)
				return false;
			wld->setBlock(ix, iy, iz, Air::getId());
			return true;
		}
	}
